(7, '1,2,3,4,5,6,8,11,12', 'Trust', '1', '3', 'Steps aid india', 'AN/2014/0083180', '196/2013', '2003-01-01 00:00:00', 'Yes', 'P. O PORT BLAIR SOUTH ANDAMAN INDIA - PIN - 744 103', 'VIVAGAN C', '', '', 'steps_aidindia@yahoo.com', 'Andaman, Nicobar', 'Andaman and Nicobar Island', '1. supporting educational aid to 125 rural poor school going children since last one year and the project is still continuing. 2. Supporting and providing free career guidance programme to 52 underprivileged educated unemployed youths. 3. Conducting various awareness programmes throughout the year and observing days of importance to create social awareness viz., environment day, population day, sports day, literacy day, disabled day and to initiate programmes of blood donation, eye donation, beach cleaning drives etc.\r\n', '', 0, '', 'Available', 0, '', '', 0, 0, '0000-00-00 00:00:00', 'Active'),
