(9, '5,15', 'Society', '3', '48315', 'Aarro welfare society', 'AR/2016/0099868', 'SR/ITA/1389', '2003-01-01 00:00:00', 'Yes', 'Yahung Tekseng Simar Colony Yingkiong PO/PS Yingkiong -791002 District Upper Siang Arunachal Pradesh', 'Yahung Tekseng', '', '', 'aarrows10@yahho.com', 'Upper Siang', 'Arunachal Pradesh', 'Targeted Intervention project on FSWs & IDUs (cc), yingkiong has been entrusted to cover 200 populations within the yingkion circle in the year 2016-2017 with the prime objective to prevent Transmission of HIV/AIDS among HRGs by peroving the essential means of service and by creating an enabling environment. AARRO IMPLEMNTATION.. 1. Greening India (three plantation) 2. 2 (Two) Awareness Generation Camps on Health & Sanitation\r\n', '', 0, '', 'Available', 0, '', '', 0, 0, '0000-00-00 00:00:00', 'Active'),
(10, '1,3,5,6,9,15', 'Society', '3', '311', 'Abralow memorial multipurpose society', 'AR/2016/0107204', 'SR-ITA-2247', '2003-01-01 00:00:00', 'Yes', 'SRI KOMINI METO,SECRETARY,AMMS/EDITOR THE ROING TIMES ,MAYU-I,ROING,DISTRICT : LOWER DIBANG VALLEY,ROING,ARUNACHAL PRADESH,PIN-792110', 'Sri Komini Meto', '', '', 'ammshunli@gmail.com', ' Lower Dibang Valley, Lohit, Dibang Valley, Anjaw', 'Arunachal Pradesh', '1. KGBV-Promoting Girl Education in Interior Pockets. 2. IEC Campaign under Total Sanitation : Nirmal Gram Puraskar 3.Water and Sanitation Campaign: Water filter and Water Quality testing kits distributed-200 kits distributed. 4. Health and Hygiene: 4 Camps conducted-800 patients treated. 5.National Environmental Awareness:Plantation-2000 Nos,Villages Covered-50 Nos. 6.Providing Quality Teacher Education in remote are and recognized by NCTE,Govt of India.\r\n', '', 0, '', 'Available', 0, '', '', 0, 0, '0000-00-00 00:00:00', 'Active'),
